  true,\n\t\"url\": null,\n\t\"notes\": \"<p>Section 4432(a) of the Balanced Budget
  Act (BBA) of 1997 modified how payment is made for Medicare skilled nursing facility
  (SNF) services. Effective with cost reporting periods beginning on or after July
  1, 1998, SNFs are no longer paid on a reasonable cost basis or through low volume
  prospectively determined rates, but rather on the basis of a prospective payment
  system (PPS). The PPS payment rates are adjusted for case mix and geographic variation
  in wages and cover all costs of furnishing covered SNF services (routine, ancillary,
  and capital-related costs).</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
